def predict(triples: list[Triple]) -> str:
    sentences = []
    for triple in triples:
        if triple.predicate == "alternativeName":
            sentences.append(f"{triple.subject} is also known as {triple.object}.")
        elif triple.predicate == "creator":
            sentences.append(f"{triple.subject} was created by {triple.object}.")
        elif triple.predicate == "fullName":
            sentences.append(f"{triple.subject}'s full name is {triple.object}.")
        elif triple.predicate == "foundedBy":
            sentences.append(f"{triple.subject} was founded by {triple.object}.")
        elif triple.predicate == "keyPerson":
            sentences.append(f"{triple.subject} has {triple.object} as a key person.")
        elif triple.predicate == "city":
            sentences.append(f"{triple.subject} is located in {triple.object}.")
        elif triple.predicate == "product":
            sentences.append(f"{triple.subject} produces {triple.object}.")
        elif triple.predicate == "lastAired":
            sentences.append(f"{triple.subject} last aired on {triple.object}.")
        elif triple.predicate == "starring":
            sentences.append(f"{triple.subject} stars {triple.object}.")
        elif triple.predicate == "firstAppearanceInFilm":
            sentences.append(f"{triple.subject} first appeared in {triple.object}.")
        elif triple.predicate == "voice":
            sentences.append(f"{triple.subject} is voiced by {triple.object}.")
        elif triple.predicate == "distributor":
            sentences.append(f"{triple.object} distributes {triple.subject}.")
        elif triple.predicate == "birthPlace":
            sentences.append(f"{triple.subject} was born in {triple.object}.")
        elif triple.predicate == "nationality":
            sentences.append(f"{triple.subject} is a {triple.object} national.")
        elif triple.predicate == "award":
            sentences.append(f"{triple.subject} won the {triple.object}.")
        elif triple.predicate == "broadcastedBy":
            sentences.append(f"{triple.subject} is broadcasted by {triple.object}.")
        elif triple.predicate == "firstAired":
            sentences.append(f"{triple.subject} first aired on {triple.object}.")
        elif triple.predicate == "series":
            sentences.append(f"{triple.subject} is part of the {triple.object} series.")
        elif triple.predicate == "child":
            sentences.append(f"{triple.subject}'s child is {triple.object}.")
        else:
            sentences.append(f"The {triple.predicate} of {triple.subject} is {triple.object}.")

    return " ".join(sentences)

